								'Note': "[Report de-identified (Safe-harbor compliant) by De-ID v.6.22.07.0]\n\n\n\n**INSTITUTION\nNEUROSURGERY\nCONSULTATION\nPATIENT NAME:  **NAME[AAA, BBB]\nACCOUNT #  **ID-NUM\n**ROOM\nATTENDING PHYSICIAN:  **NAME[YYY M ZZZ]\nCONSULTING PHYSICIAN:  **NAME[WWW M. XXX], M.D.\nDATE OF ADMISSION:  **DATE[Feb 29 2007]\nDATE OF CONSULTATION:  **DATE[Feb 30 07]\nAt the request of Dr. **NAME[YYY ZZZ, M] consulted on Mr. **NAME[AAA], a **AGE[in 60s]-year-old \nman, who presented to the hospital with a one-day history of confusion.  Two \ndays ago he was very active.  Imaging studies showed evidence of a \nhemorrhagic mass within the splenium of the corpus callosum.  Today when I \nsaw the patient, he had significantly improved and was asking appropriate \nquestions. \nInterestingly, the patient had presented with some back pain and headache \nback in **DATE[May] where imaging studies showed evidence of lumbar disk disease.  \nHowever, an MRI scan was also done showing evidence of FLAIR signal change \nwithin the corpus callosum.  This was observed.  An **DATE[Sep 2006] scan was reported \nto show significant resolution of the mass. I reviewed both of these studies \nand was concerned that perhaps the **DATE[Sep] scan did not show it because of the \ndifferent slice thicknesses.  However, the lesion did appear smaller in \n**DATE[Sep].  He had an MRI scan in this hospital during this admission which \ncontinued to show FLAIR change in the corpus callosum with gradient imaging \nthat showed the hemorrhage.  A CT scan also showed hemorrhage.  There was \nminimal enhancement.  An angiogram was performed today which was reportedly \nnegative for a vascular malformation or other specific disease.   \nPHYSICAL EXAMINATION:\nOn examination the patient was awake, alert, and has answered questions \nappropriately.  Language is normal.  He showed insight into his problems.  \nEye movements were full with slight restriction of up gaze.  There was no \nlimb drift.  Power was full.   \nI reviewed all the imaging studies with his family.  We talked about \nmanagement options including observation with serial imaging studies, empiric \ntherapy which we did not recommend, and believe that few would empirically \nirradiate this lesion, a stereotactic biopsy to obtain a histologic diagnosis \nto guide further management, or craniotomy (we told them that the lesion was \ntoo small and deep for a craniotomy).  There was a family history of \nmeningioma, but we thought this lesion did not look like that.   \nPLAN:\nOur plan is to allow him to recover from the small hemorrhage and obtain a \nrepeat MRI scan in two days' time.  If he is well, we will discharge him and \nbring him back next week for an MRI-guided stereotactic brain biopsy.  The \nrisks of this were explained including bleeding in the brain causing stroke, \ndeath, the need for craniotomy, lack of diagnosis, memory problems, seizures, \nheadache, or lack of a good result.  All questions were answered and we will \nmake arrangements for surgery next week.   \n\n___________________________________\n**NAME[WWW M. XXX], M.D.\n\nDictator:  **NAME[WWW M. XXX], M.D.\n**INITIALS\nD:  **DATE[Feb 30 2007] 16:50:17\nT:  **DATE[Feb 31 2007] 04:00:38\nR:  **DATE[Feb 31 2007] 09:21:07/lmm\nJob ID:  368439/**ID-NUM\n\n*** Dictated By: -**NAME[XXX, TTT M]. ***\nElectronically Signed by **NAME[WWW XXX]  **DATE[Mar 12 2007] 02:51:18 PM\n\n\n\n\n\n\n",
