								'Note': '[Report de-identified (Safe-harbor compliant) by De-ID v.6.22.06.0]\n\n\n\n**INSTITUTION\nEMERGENCY DEPARTMENT\nPATIENT NAME:  **NAME[AAA, BBB]\nACCOUNT #:  **ID-NUM \nDATE OF SERVICE:  **DATE[Feb 29 07] \nPRIMARY CARE PHYSICIAN: **NAME[TTT M SSS]\nHISTORY OF PRESENT ILLNESS:  \nCHIEF COMPLAINT:  Transferred from the outside hospital for a brain lesion \nand confusion. \nHPI:  The patient is a **AGE[in 60s]-year-old Caucasian male with no significant past \nmedical history, but had a brain tumor mentioned awhile ago, who was \ntransferred from **INSTITUTION for further evaluation of the brain lesion.  \nApparently this morning the patient was found to be disoriented and confused. \n He was missing for about three hours and also was not appropriate.  The \npatient himself mentioned about him not feeling very well, so the family took \nthe patient to the emergency department where he was found to be disoriented \nto time, place, and person and subsequent CT scan of the head showed a lesion \nin his brain that looked either a tumor or bleeding.  For further evaluation, \nthe patient was referred to Neurosurgery, Dr. **NAME[ZZZ], for further evaluation, \nand presented to the emergency department.  On presentation to the emergency \ndepartment, the patient was awake, alert, but not oriented.  He was confused \nwith time, date, and also place.  He denied any headache, nausea, vomiting, \ndifficulty moving his extremities, or sensory problems.   \nPAST MEDICAL HISTORY:  \nThe past medical history includes:\n1. Surgical appendectomy.\n2. Lipoma resection.\n3. Also tonsillectomy.\nMEDICATIONS:\nThe patient states that he does not take any medications.\nSOCIAL HISTORY:  \nHe does not smoke, drinks about a bottle of beer a day.\nALLERGIES:\nNO KNOWN DRUG ALLERGIES. \nPHYSICAL EXAMINATION:  \nGENERAL:  This is a Caucasian male not in acute distress; however, confused \nand disoriented to time, place, and person.   \nVITAL SIGNS:  Blood pressure is 130/68, pulse is 66 and regular, respiratory \nrate is 17, and saturation is 100% on two liters nasal cannula.   \nHEENT:  Pupils are equally round and reactive to light.  Extraocular \nmovements are intact, no diplopia.   \nLUNGS:  Clear to auscultation bilaterally.\nHEART:  Regular rate and rhythm, no murmur.\nABDOMEN:  Soft, nontender, nondistended.\nEXTREMITIES:  No swelling or redness.\nNEURO:  Cranial nerves II through XII intact.  Strength is 5/5 throughout.  \nSensation is intact.   \nLABORATORY DATA/STUDIES:\nA CT scan of the head obtained showed a brain lesion, possible tumor or \nbleed.  An MRI was ordered and the result is pending by the time of \ndictation.  Blood work was obtained.  Those were not significantly abnormal.  \n\nASSESSMENT AND PLAN:\nThis is a **AGE[in 60s]-year-old male who has questionable history of a brain tumor in \nthe past without any treatment who presented with confusion, found to have a \nbrain lesion by CT scan.  The patient continues to be confused; however, \nvital signs were stable and there was no significant neurological finding \nother than his confusion.  Here Neurosurgery was  \ncontacted and since the patient already had a bed under Dr. **NAME[ZZZ], he was \nadmitted to 5F for further evaluation of his brain lesion.  The patient \nremained hemodynamically and neurologically stable throughout this emergency \ndepartment stay. \nADMITTING DIAGNOSIS:  BRAIN MASS.\n___________________________________\n**NAME[RRR QQQ], M.D.\n\nDictator:  **NAME[WWW XXX], M.D.\n**INITIALS\nD:  **DATE[Feb 29 2007] 18:38:13\nT:  **DATE[Feb 29 2007] 19:47:41\nR:  **DATE[Feb 29 2007] 19:47:41/klf\nJob ID:  367063/**ID-NUM\nCc:\n\n*** Dictated By: -**NAME[XXX, PPP] ***\nElectronically Signed by **NAME[RRR QQQ]  **DATE[Mar 02 2007] 11:02:34 AM\n\n\n\n\n\n\n',
