								'Note': "[Report de-identified (Safe-harbor compliant) by De-ID v.6.22.07.0]\n\n\n**INSTITUTION\nConsultation\nName: **NAME[AAA, BBB]\nAcct #: **ID-NUM\nMRN: **ID-NUM\nAdmitted: **DATE[Nov 01 2007]\nDate: **DATE[Nov 04 2007]\nDict: **NAME[XXX, WWW]\nAttend: **NAME[ZZZ, YYY]\nPhysical Medicine and Rehabilitation Consult.\nI was asked by Dr. **NAME[ZZZ] to determine and comment on **NAME[BBB AAA]'s \nrehabilitation options and needs.\nMr. **NAME[AAA] is an **AGE[in 80s]-year-old right-handed male admitted to **INSTITUTION on **DATE[Nov 1 2007].  The patient's chief complaint is increasing \ncolostomy output and weakness.\nThe patient's history began late **DATE[Sep 2007] when he felling incurring a \nclavicle fracture.  He was treated at **INSTITUTION.  While there, he \ndeveloped sepsis and transferred to **INSTITUTION for further \ntreatment and management.  Blood cultures from **INSTITUTION grew E. coli.  \nWhile at **INSTITUTION, the patient was found to have a right lung pneumonia on \nchest x-ray as well as CT scan.  He completed a course Zosyn.  During his \nstay, the patient developed a sudden onset right hemiparesis from a left \nparietal and bilateral inferior cerebellar CVA.  The patient was placed on \naspirin and Plavix.  He was discharged to **INSTITUTION, **PLACE for a \nrehabilitation program. \nThe patient stayed approximately a week and a half.  He was readmitted to \n**INSTITUTION with a productive cough.  Workup included bronchoscopy which \nrevealed a fungal infection on cultures.  The patient was placed on IV \nDiflucan and subsequently discharged back to **INSTITUTION, **PLACE.\nRecently, the patient was admitted to **INSTITUTION with increasing \ncolostomy output.  He was noted to have leukocytosis with a white count of \n24,000 and 23% bandemia.  The patient was transferred to **INSTITUTION on **DATE[Nov 1 2007], for further treatment.\nThe patient was diagnosed as having C. difficile colitis.  His C. difficile \ntoxin assay was positive from his **DATE[Nov 1 2007], stool sample.  His blood \ncultures have shown no growth.  The patient has been placed on Lactobacillus \nalong with Flagyl.  He has shown clinical improvement with decreased \ncolostomy output.  His WBC count has decreased to 8.6.  The patient was also \ndehydrated, and his creatinine since improved to 1.4.  His chest CT showed \npersistent right upper lobe consolidation, but overall improved from previous \nradiographs.\nFrom a functional standpoint, the patient requires minimal assistance with \nhis transfer, minimal assistance to ambulate 5 feet using a wheeled walker, \nand requiring assistance to open his containers during meals.\nPAST MEDICAL HISTORY:  Coronary artery disease status post coronary artery \nbypass graft in 2001, history of MI, hypertension, colorectal CA status post \ncolostomy 15 years ago, and hyperlipidemia.\nFAMILY HISTORY:  Positive for coronary artery disease.\nALLERGIES:  THE PATIENT HAS NO KNOWN DRUG ALLERGIES.\nMEDICATIONS:  As listed in the 36-hour report.  I have reviewed this list.\nPERSONAL AND SOCIAL HISTORY:  The patient is a retired coal miner.  He lived \nalone prior to his admission.  A former smoker.  Drinks alcohol occasionally. \nHe was independent prior to admission.\nREVIEW OF SYSTEMS:  The patient feels tired and weak.  His right is weaker \ncompared to his left.  He denies any chest pain.  He does have exertional \ndyspnea, but overall better.  He reports cough, but this is also improved.  \nHe denies any swallowing problems.  Currently has a Foley catheter in place.  \nHe reports being continent prior to admission.  He has no neck or back pain.  \nHe denies any numbness or paresthesias.  Rest of his review of systems is \nnegative.\nPHYSICAL EXAMINATION:  The patient is thin elderly male.  He is awake.  He is \nalert.  He is oriented x3 in no acute distress.  His voice is wet and gurgly, \nhypophonic, but easily understandable.  Heart:  Distant.  Lungs:  With \nscattered rhonchi.  Abdomen: Soft and nontender.  Extremities: He has trace \nbilateral pretibial edema.  Skin:  Dry and scaly.  I did not look at his \nsacral coccyx for any pressure ulcers.  Neurologic:  He has full passive \nrange of motion of both upper and lower extremities with minimal pain at the \nend range.  Manual testing, left upper extremity is 5/5, right upper \nextremity is 3 to 4 over 5; in both lower extremities, it is limited \nsecondary to his position, but left TA and EHL is 5/5 and right TA and EHL is \n4+/5.  Muscle stretch reflexes are slightly brisker on the right.  He does \nnot have any clonus, and his plantar reflex is equivocal.  He does have \ndysmetria in both upper extremities, more significant on the right.\nIMPRESSION:  The patient is an **AGE[in 80s]-year-old male with a history of left \nparietal cerebrovascular accident and right hemiparesis.  He is admitted with \nClostridium difficile colitis.  He has had extensive and complicated course \nsince his initial admission in **DATE[Sep 2007].  He is not at his functional \nbaseline with decline in functional mobility, self care, as well as speech.\nRECOMMENDATIONS:  \n1.  Consider modified barium swallow to evaluate his current swallowing \nstatus.\n2.  Agree with deep venous thrombosis prophylaxis.\n3.  The patient will require an admission to the acute inpatient \nrehabilitation service.  He has the comprehensive therapy needs with physical \ntherapy, occupational therapy, and speech and language pathology to address \nhis functional decline as well as extensive active medical issues requiring \nclose supervision and judicious management.\nThank you for allowing me to participate in his care.\n______________________________\n**NAME[WWW XXX], MD\nHS Job # 503658 / 36756 / \nSHY # **ID-NUM\nD: **DATE[Nov 04 2007] 18:20\nT: **DATE[Nov 05 2007] 03:41\n\n**CARBON-COPY\n\n\n\n\n",
