								'Note': '[Report de-identified (Safe-harbor compliant) by De-ID v.6.22.07.0]\n\n\n**INSTITUTION\nDischarge Summary\nName: **NAME[AAA, BBB]\nAcct #: **ID-NUM\nMRN: **ID-NUM\nAdmitted: **DATE[Nov 01 2007]\nDischarged: **DATE[Nov 05 2007]\nDict: **NAME[ZZZ, YYY]\nAttend: **NAME[ZZZ, YYY]\nFINAL DIAGNOSES:  \n1.  Acute Clostridium difficile colitis.\n2.  Diarrhea secondary to the above.\n3.  Dehydration.\n4.  Hypertension, improved.\n5.  Acute renal failure, prerenal in nature, improved.\n6.  Questionable deep venous thrombosis in the right arm, but venous Dopplers \nare negative.\n7.  Anemia.\n8.  Recent pneumonia with persistent cough and sputum.\n9.  Severe cough and pulmonary congestion.\n10.  Rule out congestive heart failure, but doubt.\n11.  Recent cerebrovascular accident.\n12.  Nausea and intolerance to some medications.\n13.  Cardiac ectopies with sinus tachycardia and premature atrial \ncontractions.\n14.  Recent cerebrovascular accident in early with right-side residual \nweakness.\n15.  Recent urosepsis with Escherichia coli in early **DATE[Oct], improved.\n16.  Recent severe acute renal failure, improved on this admission, and he \ncame back with renal failure and improved again.\n17.  Depression.\n18.  Physical and mental deconditioning.\n19.  History of colon cancer, status post colectomy and colostomy.\n20.  History of coronary artery disease.\n21.  Previous myocardial infarction about 15 years ago.\n22.  Status post coronary artery bypass grafting about 5 or 6 years ago.\nDISCHARGE MEDICATIONS:  \n1.  Percocet 5 mg q.6h. as needed.\n2.  Mucomyst via nebulizer twice a day.\n3.  DuoNeb q.i.d.\n4.  Aggrenox 25/200 twice a day.\n5.  Xenaderm for certain decubitus areas.\n6.  Aranesp 40 mcg once a week.\n7.  Lovenox 45 mg b.i.d. stopped at the time of transfer.\n8.  Mucinex 1200 mg twice a day.\n9.  Heparin 5000 units subcutaneously q. 12h.\n10.  Lactinex one packet b.i.d. for one week.\n11.  Megace 40 mg p.o. b.i.d.\n12.  Flagyl 500 mg three times a day for one week.\n13.  Nasonex spray each nostril twice a day.\n14.  Protonix 40 mg daily.\n15.  Lotensin 20 mg p.o. daily.\nHISTORY:  Mr. **NAME[AAA] is an **AGE[in 80s]-year-old pleasant man who was discharged \nrecently to **INSTITUTION Rehab after a long admission for throat, renal \nfailure, sepsis, and severe pneumonia.  He was doing well at the rehab; \nhowever, on the night before the day of admission, he started to have \ndiarrhea.  He did not respond to treatment.  C. diff toxin was sent, but the \npatient became hypotensive, his creatinine went up to 2 and BUN became \nelevated.  He became tachycardic, and showing irregular heart beats.  For all \nthese reasons, he was transferred to **INSTITUTION for further \nmanagement and evaluation.\nHOSPITAL COURSE:  The patient was admitted with initial problems that \nincluded severe diarrhea confirmed later to be from C. diff colitis, it was \ntreated with Flagyl and Lactinex\n\\\tand seemed to improve slowly.\nHis other issue was hypotension and tachycardia related to dehydration and \nlow volume.  It was corrected with IV fluids.\nHe had renal failure on admission, the creatinine was 2.0 and elevated BUN.  \nThat seemed to correct with IV fluids, creatinine improved down to 1.2.\nHe was tachycardic and showing irregular heart beats on admission, that \nseemed to improve to normal sinus rhythm with controlled rate at the time of \ndischarge.\nThe patient had swelling in the right arm, there was question of DVT.  \nHowever,  venous Dopplers came back negative.  I would still watch that \nclosely, consider further evaluation if the swelling continues.\nThe patient continues to have the problem with dysphagia.  He is on dysphagia \ndiet.\nHowever, his main complaint and problem seem to be persistent congestion in \nthe lungs and sputum production and cough.  He had recent pneumonia which \nseemed to be getting better on CT scan and chest x-ray.  I wonder if he has \neither components of microaspiration or postnasal drip which could be \ncontributing.  Appropriate treatments are being given to that.  Other agents \ncould be added later in the future.\nAs the patient seemed to improve from the diarrhea standpoint and as his \nkidney function coming back to normal, his blood pressure and heart rate are \nimproving, we felt that he could go back to the **INSTITUTION Rehab to continue \nphysical therapy and rehabilitation.  He will continue his medications.  He \nneeds to follow up with his right arm swelling and his lung status.\nLABORATORY DATA:  Prior to discharge, his stool for occult blood was \nnegative.  His sodium was 140, potassium 3.9, chloride 119, BUN 17, \ncreatinine 1.4, calcium 8.2.  His INR was 21, TIBC 1 was 7 and iron \nsaturation was 20%, ferritin 251.\nHemoglobin was 9.0, hematocrit 26.8, and platelet count 255.\nDISPOSITION:  **INSTITUTION Rehab in stable condition.  Continue to follow at \nthat institution.    \n______________________________\n**NAME[YYY ZZZ], MD\nHS Job # 573690 / 33110 / \nSHY # **ID-NUM\nD: **DATE[Dec 18 2007] 18:57\nT: **DATE[Dec 18 2007] 21:03\n\n*** Transcribed On: **ID-NUM ***\n*** Dictated By: 008687^**NAME[ZZZ^YYY] ***\n*** Clinical Date : **ID-NUM ***\nElectronically Signed by **NAME[YYY ZZZ]  **DATE[Dec 21 2007] 01:21:17 AM\n\n\n\n\n\n\n',
