								'Note': '[Report de-identified (Safe-harbor compliant) by De-ID v.6.22.07.0]\n\n\n**INSTITUTION\nConsultation\nName: **NAME[AAA, BBB]\nAcct #: **ID-NUM\nMRN: **ID-NUM\nAdmitted: **DATE[Nov 01 2007]\nDate: **DATE[Nov 02 2006]\nDict: **NAME[XXX, WWW]\nAttend: **NAME[ZZZ, YYY]\nMr. **NAME[AAA] is a distant smoker who is now admitted with C. diff.  In early \n**DATE[Oct], he was admitted with a pneumonia and new stroke.  It was feared at \nthat time that he may have had an endocarditis with an embolic stroke.  CT \nscan performed in early **DATE[Oct] showed a severe right upper lobe dense \nconsolidated pneumonia with air bronchograms which were not consistent with \npostobstructive pneumonia.  He was treated with Zosyn, after results of his \nsputum culture came back revealing Pseudomonas cepacia.  Apparently, he had \nhad a bronchoscopy done at **NAME[VVV] prior to that admission that grew some \nyeast, and there is concern about a possible yeast infection.  He was \ntransferred to rehabilitation on **DATE[Oct 9 2007], on Zosyn 4.5 IV q.12 hours \nfor 2 weeks total duration.  He developed diarrhea yesterday, and therefore \nwas readmitted with possible C. diff colitis.\nPAST MEDICAL HISTORY:  Remarkable for known coronary disease status post \nbypass grafting.  He is a very distant smoker.  No history of obstructive \nlung disease.  He had a history of rectal carcinoma status post a partial \ncolectomy with a colostomy.  \nSOCIAL HISTORY:  Unhelpful.\nREVIEW OF SYSTEMS:  Pertinent for cough productive of frothy white sputum.  \nNo hemoptysis.  Denies fevers, chills, or sweats.  No chest pain, PND, \northopnea, or pedal edema.  He has been on oxygen since he was admitted to \nthe hospital in **DATE[Oct] with pneumonia.  \nPHYSICAL EXAMINATION:  He is afebrile with a blood pressure of 130/68, his \nheart rate is in the mid 90s, respiratory rate is 18.  His saturations in the \nmid 90s on 3 L nasal cannula.  He is an awake, alert, thin, ill-appearing \ngentleman in no distress.  Neck is supple without JVD.  His lungs are \nbronchial on the right, scattered rhonchi, no wheezes.  Regular rate and \nrhythm on cardiac exam, slightly tachycardic, no S3 or rub.  Abdomen is soft, \nscaphoid, no organomegaly or masses.  Ostomy in the left lower quadrant with \na bag filled with greenish liquid stool.  He had no significant edema.  \nLABORATORY DATA:  Sodium 136; potassium 3.4; chloride 106; bicarbonate 21; \nBUN and creatinine of 29 and 2.4; blood glucose of 97; white count of 17,300 \ndown from 19,800; H and H are 9.9/28.9 with 265,000 platelets.  Sputum is \ngrowing rare normal flora.  His CT scan shows persistence, although improved \naeration in the right upper lobe.  The left lower lobe and lateral lingula \nshow improvement in infiltrates.  \nMr. **NAME[AAA] is a gentleman that had a severe pneumonia.  Pneumococcus was \ncertainly a possible etiology that did not grow, although Pseudomonas cepacia \ndid eventually grow and he was treated with Zosyn.  Unfortunately, he seems \nto have developed C. diff, although those results are pending.  He is \ncurrently on Flagyl for that.  From a pulmonary standpoint, he still has \nsignificant radiographic abnormalities, but they have improved.  The air \nbronchograms are inconsistent with a postobstructive pneumonia.  At this \ntime, he has received adequate antibiotics and I would withhold further \nantibiotics from a pulmonary standpoint.  Mucomyst and nebulized \nbronchodilators are reasonable to help him clear his secretions, and he will \nneed a followup CT scan in about 2 months to document further clearing of \nthat upper lobe infiltrate.  \nThank you very much.  \n______________________________\n**NAME[WWW XXX], MD\nHS Job # 440707 / 36231 / \nSHY # **ID-NUM\nD: **DATE[Nov 02 2007] 11:36\nT: **DATE[Nov 02 2007] 11:41\n\n**CARBON-COPY\n\n\n\n\n',
