								'Note': '[Report de-identified (Safe-harbor compliant) by De-ID v.6.22.06.0]\n\n\n\n**INSTITUTION\nEMERGENCY DEPARTMENT\nPATIENT NAME:  **NAME[AAA, BBB]\nACCOUNT #:  **ID-NUM \nDATE OF SERVICE:  **DATE[Feb 29 07] \nPRIMARY CARE PHYSICIAN: **NAME[TTT M SSS]\nATTENDING PHYSICIAN ADDENDUM: \nI saw the patient with the resident. The history, physical and plan were \nreviewed, I concur with their findings. I also independently examined and \nquestioned the patient.  \nHISTORY OF PRESENT ILLNESS:  \nMr. **NAME[AAA] is **AGE[in 60s]-year-old gentleman who reportedly this morning forgot to \npick up his granddaughter from school, was then confused while driving and \nreportedly missed his driveway. The patient was seen at and outside hospital \nand a CT was done and there was what appeared to be an intracranial bleed \nversus mass seen. He was sent here for further evaluation by Neurosurgery. \nThe patient reports that he had a " mass in past" but it went away. He denies \nany focal numbness, weakness or tingling right now. No headache, no vision \nchanges, no nausea, no vomiting and no other medical symptoms to report. \nREVIEW OF SYSTEMS:  \nHis review of systems is negative. \nHis allergies, past medical history and social history are per the resident \ndictation. \nHis medications are none. \nPHYSICAL EXAMINATION:\nTemperature 36.9, 60, 118, 130/68.\nGENERAL: The patient is alert on my assessment. He is oriented to person and \nplace, but not so much the situation. He appears to be in no distress.  \nHEENT: The head is atraumatic. His pupils are equal and around. Sclerae is \nanicteric, unable to evaluate the fundus. Oropharynx is clear and moist.  \nNECK: The neck is supple. \nCARDIOVASCULAR: Regular rate and rhythm.\nLUNGS: The lungs are clear to auscultation.\nABDOMEN: The abdomen is soft, nontender and nondistended.\nNEURO: Neurologically his speech is clear and fluent, occasionally he is not \nmaking sense. I would give him a GCS of 14. On motor exam he has no evidence \nof pronator drift and (5/5) strength in the upper and lower extremities. \nFinger-to-nose is intact bilaterally.  \nED COURSE AND MEDICAL DECISION:  \nThe patient was seen by myself and the resident. The gentleman had either a \nbleed or a mass on his head CT at the posterior portion in the ventricle. It \nwas well demarcated and it appears to be more or a mass with possible \ncalcification or bleeding. We will repeat the head CT and obtain a MRI per \nNeurosurgery recommendation. The patient was planned to be a direct admit to \n5F and we are awaiting for his bed at this time. He otherwise remained \nneurologically intact during my exam, except as above and this was unchanged. \n\nRoutine laboratory data was sent. His INR is pending, but from the outside \nhospital this was less than 1. He is on no anticoagulants. I do not think \nthis represents meningitis or encephalolitis at this time. We will have him \nadmitted to neurosurgery.  \nADMISSION DIAGNOSIS(ES): \nINTRACRANIAL HEMORRHAGE.\nAdmit to Neurosurgery **ROOM. _____________________________\n**NAME[WWW XXX], M.D.\nEMERGENCY MEDICINE \nAttending Physician \nDictator:  **NAME[WWW XXX], M.D.\nJK/dab\nD:  **DATE[Feb 29 2007] 17:45:26\nT:  **DATE[Feb 29 2007] 18:10:22\nR:  **DATE[Feb 29 2007] 18:10:22/dab\nJob ID:  367006/**ID-NUM\nCc:\n\n*** Dictated By: -**NAME[XXX, RRR] ***\nElectronically Signed by **NAME[WWW XXX]  **DATE[Mar 02 2007] 11:02:31 AM\n\n\n\n\n\n\n',
